import React, {Component} from 'react';

class PayCard extends Component{
  render(){
    return(
      <div className="card" style={{width:"500px",height:"600px", marginTop:"50px",display: "inline-block"}}>
        <div className="view overlay" >
          <a href="#!">
            <div className="mask rgba-white-slight"></div>
          </a>
        </div>
        <div className="card-body" style={{width: "500px",height:"200px"}} >
          <h1 className="card-title" style = {{fontSize:"21px",textAlign: "center",marginTop: "5px"}}>Woodstock's Pizza</h1>
          <p id="description" className="card-text" style = {{fontSize:"16px",textAlign: "center",marginTop: "25px"}}>@woodstockspizza requests $23.20 for 16" X-Large Cheese Pizza.</p>
          <a id="decline" href="home" className="btn btn-light" style = {{left:"50%",marginLeft:"-175px", width:"350px",height:"65px",fontSize:"16px",paddingTop: "22px",marginTop: "15px"}} > No Thanks</a>
          <a id="card" href="#" className="btn btn-light" style = {{left:"50%",marginLeft:"-360px", width:"350px",height:"65px",fontSize:"14px",paddingTop: "37px",marginTop: "15px",display: "inline-block",visibility: "hidden"}}>PayJunction balance:<br/><div style={{color:"#818181",marginTop:"10px",fontSize:"16px"}}>$573.29</div></a>
          <br /> 
          <a id="pay" href="#" className="btn btn-info" style = {{left:"50%",marginLeft:"-175px", width:"350px",height:"65px",fontSize: "16px", paddingTop: "22px",marginTop: "10px"}} onclick="fadeButton()" > Pay Now</a>
          <a id="return" href="home2" className="btn btn-light" style = {{left:"50%",marginLeft:"-175px", width:"350px",height:"65px",fontSize:"16px",paddingTop: "22px",marginTop: "-80px",visibility: "hidden"}}> Return to Home</a>
          <br />
          <p id="report" className="card-text" style = {{fontSize: "14px",textAlign: "center",marginTop: "15px"}}>Think there was a mistake?&nbsp 
            <a href="#" className="link" style = {{width:"250px",height:"35px",fontSize:"14px"}}> Report your error
            </a>
          </p>
        </div>
      </div>
    );
  }

}

export default PayCard;
